import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    p:{
        color:'#15f4ee',
        alignItems: 'center',
        justifyContent: 'center',
    },
    img:{
        paddingBottom:0,
        position:"absolute",
        paddingLeft: 0,
        width:"100%",
    }
})

export default styles
